INSERT INTO `journey` VALUES (1,'2010-09-07 00:00:00','Weymouth to  Bristol City Center',45.10,'66.00',269,'',1),(2,'2010-09-08 00:00:00','Bristol - Wocester',NULL,'63.00',246,'',1),(3,'2010-09-09 00:00:00','Wocester to Manchester',31.50,'114.00',532,'',1),(4,'2010-09-10 00:00:00','Manchester - Silverdale',27.50,'74.28',329,'',1),(5,'2010-09-11 00:00:00','Silverdale - Wastwater (Skafell Pikel)',36.60,'55.96',305,'Wet  but good campsite at bottom of tallest peak in England',1),(6,'2010-09-12 00:00:00','Wastwater - Cockermouth via. Black Fell Pass',30.40,'27.19',207,'Path through mountains was not meant for bike .. hauled bike over mountain pass, took three hours.',1),(7,'2010-09-13 00:00:00','Cockermouth - Carlise - Hawes (Yorkshire Dales)',47.10,'90.27',435,'Great riding through the Dales even in the pissing rain, stayed in Hawes where bar stuff where very hospitable, giving me a room for £10',1),(8,'2010-09-14 00:00:00','Hawes - Ripon - Leeds - Sheffield  - Belper (miles short of Derby)',37.70,'136.16',615,'Longest ride so far',1),(9,'2010-09-15 00:00:00','Derby - Tamworth, train to Glocester, Glocester - Bristol, train to weymouth',30.30,'77.40',377,'Had to be back in Weymouth for depature to St. Malo with Dad next day.',1),(10,'2010-09-16 00:00:00','Weymouth - St.Malo via. Jurnsey',23.60,'18.47',131,'Most of miles here done on the island of Jeurnsey whilst waiting for Ferry.',2),(11,'2010-09-17 00:00:00','St. Malo - Renees',29.60,'63.84',349,'',2),(12,'2010-09-18 00:00:00','Renne - 8k North of Geur',29.50,'50.67',278,'',2),(13,'2010-09-19 00:00:00','Guer - St. Nazarine',34.10,'64.24',335,'',2),(14,'2010-09-20 00:00:00','St. Nazzarine - St. Jean de Mat',NULL,'56.95',300,'',2),(15,'2010-09-21 00:00:00','St Jean de Mat - Trantes-der-mer',22.20,'59.79',311,'',2),(16,'2010-09-22 00:00:00','Trantes-der-mer - Rochfort',21.40,'74.02',416,'',2),(17,'2010-09-23 00:00:00','Rochfort - Blaye',34.90,'74.53',381,'',2),(18,'2010-09-24 00:00:00','Blaye - Somewhere in Nat. Park Northwest of Bordeux',28.90,'70.35',342,'',2),(19,'2010-09-25 00:00:00','Somewhere - Leon',24.10,'67.71',313,'',2),(20,'2010-09-26 00:00:00','Leon - Birratiz',NULL,'38.00',205,'Estimates as CP data lost',2),(21,'2010-09-28 00:00:00','Biarritz - Azkoitia (Spain)',32.40,'70.51',411,'',2),(22,'2010-09-29 00:00:00','Azkotitia - Castro-Uridiales',33.50,'81.14',477,'',2),(23,'2010-09-30 00:00:00','Castro-Uridiales - Santander',31.70,'53.16',291,'End of Stage 2',2),(24,'2010-10-01 00:00:00','Santander - Muskiz, nr. Bilbio',40.10,'82.77',412,'',3),(25,'2010-10-02 00:00:00','Muskiz - Artega (North Coast)',NULL,'58.52',313,'Frustrated getting through Bilbio, didnt make good time',3),(26,'2010-10-03 00:00:00','Artega - Hendaye (France)',37.20,'83.06',428,'Good riding day, good route, severe wind, no open campsites.',3),(27,'2010-10-04 00:00:00','Hendaye -Ascarat (Pyrenees)',37.50,'61.84',367,'',3),(28,'2010-10-05 00:00:00','Ascarat - La pierre Saint Martin',35.80,'52.50',408,'Cols are hell',3),(29,'2010-10-06 00:00:00','col de la pierre st martin - laruns',40.60,'49.53',287,'easy',3),(30,'2010-10-07 00:00:00','Larruns - Luz-Saint-Sauver',35.40,'44.65',280,'col d\'abisque , col de soulor',3),(31,'2010-10-08 00:00:00','Luz-Saint-Saveur - Arreau',42.20,'49.05',316,'Tormalet + Aspin',3),(32,'2010-10-09 00:00:00','Arreau - Lagrave',37.00,'45.26',288,'Climbed Col de Peyresourde and Port de Bains',3),(33,'2010-10-11 00:00:00','Lagrave - Sieux',35.60,'77.76',475,'Damp day, 3 cols, Col de Binente, Col d\'Aspen and Col de la Core. Wet but not too wet, got lost but not too lost.',3),(34,'2010-10-12 00:00:00','Sieux - Ax-les-Thermes',33.50,'56.83',334,'Col d\'Agnes and Col Pont le Lers (?). Again wet, and cold on the descents.',3),(35,'2010-10-13 00:00:00','Ax-les-Thermes - Prades',33.70,'66.12',409,'2001m Col followed by some minors, spent most of day at 1500m before descending from Mont-Louis for ~1.5hrs to here.',3),(36,'2010-10-14 00:00:00','Prades - Saint Marie sur le mer',33.20,'41.22',173,'Short ride to exit the Pyrenees, went as fast as possible from Prades to Perpignon - Tme: 1:25, Dst: 27.04, Av: 18.9 Mx:',3),(37,'2010-10-16 00:00:00','Saint-Marie sur mer - Adjes',NULL,'81.14',391,'Riding against wind for first part to Narbonne, faster pace for remainder',3),(38,'2010-10-17 00:00:00','Cod d\'Adge - Nime',27.00,'75.30',393,'via. Montpellier, and arrived amid the aftermath of the Marathon, of which I was unaware.',3),(39,'2010-10-19 00:00:00','Nimes - Marsaille',41.50,'89.65',387,'Strong wind behind me, effortless ride most of the way.',3),(40,'2010-10-20 00:00:00','Marsailles - Cassis',43.60,'12.08',53,'Ran in Marsailles for 3hrs 48min',3),(41,'2010-10-22 00:00:00','Cassis - Le Lavandou',37.30,'67.62',338,'Illegal to die here',3),(42,'2010-10-24 00:00:00','Le Lavendou -  Villeneuve Laurant',27.60,'96.71',470,'',3),(43,'2010-10-27 00:00:00','Villeneuve Laubert - Sospel',27.70,'49.43',283,'Back in the mountains. Col de Castillion (~705m)',4),(44,'2010-10-28 00:00:00','Sospel - Saint Martin Vésubie',32.30,'36.22',262,'Col de Turini',4),(45,'2010-10-29 00:00:00','St-Martin Vesubie - Valberg (Ski Station)',34.30,'37.67',283,'2 cols: Col de la croix de Valberg 1700m (inc. Col de la Couollole) and Col de Saint Martin. Exhausting.',4),(46,'2010-10-30 00:00:00','Valberg- Barcellonnete',35.80,'49.13',271,'Snow. Truly beutifull going up the highest pass to date, Col de Cayolle (2326m)',4),(47,'2010-10-31 00:00:00','Barcelonnette - Briancon',33.10,'57.30',325,'Col de vars (2111m). Tough descent from the col in the rain and snow. Rain constant theme of the day.',4),(48,'2010-11-01 00:00:00','Briancon - Grenoble',39.30,'71.05',304,'Snowy at the top of \"Col de Lauteret\" (2011m), great downhill run for ~50 miles through Bourg de Osains to Grenoble. All Saints day (jour toutsaintes), so most shops closed.',4),(49,'2010-11-03 00:00:00','Grenoble - St Jean Maurienne',38.00,'64.58',394,'Col de la croix de fer (2068m)',4),(50,'2010-11-04 00:00:00','St-Jean-de-Maurienne - Bourg-St-Maurice',35.00,'70.00',330,'Estimates as data lost, flat and easy day. Weather fine.',4),(51,'2010-11-05 00:00:00','St-Jean-de-maurienne - Notre Dame de Bellecombe',36.30,'45.25',326,'Col de Saises (1650m) and Comet de roseland (1968m)',4),(52,'2010-11-06 00:00:00','Notre Dame de Bellecombe - Cluses',40.30,'54.60',314,'Col des Aravis (1486m), Col de Columbière (1613m)',4),(53,'2010-11-07 00:00:00','Cluses - Thonon-les-bains',28.90,'38.24',202,'Last col, Col des Gets (1170m). Another cold and wet journey to end the stage',4),(54,'2010-11-11 00:00:00','Circuit du roc d\'enfer',37.10,'64.82',286,'Actually deviated from route by accident and came back via. col de gets after Col de la Ramaz (1559m). Very white and snowy there, and I was ill-prepared for the cold descent, was glad to see a lower altitude!',5),(55,'2010-11-14 00:00:00','Circuit of lac leman / lake geneva',30.40,'108.51',406,'Nice flat circuit, passed through Geneva, Laussane and Montreaux.',5),(56,'2010-11-17 00:00:00','Circuit de Gavot',36.90,'22.56',88,'Short ride, 990m altitude, nice views.',5),(57,'2010-11-18 00:00:00','Attempted Circuit de Mnt Hermoine',32.90,'25.12',108,'Took wrong turning, and was getting dark when I eventually corrected myself so, ahem, I turned back',5),(58,'2010-11-20 00:00:00','Thonon-les-bains - Marcellaz',27.30,'33.78',176,'Became very cold with wind-chill on the flat, if slightly undulating, ride to Annemasse, where i had a coffee then turned and eventually found my way to Marcellaz, where I am working on a Farm for the next week before leaving for Paris.',5);
