INSERT INTO `stage` VALUES (1,'Stage 1 - The North','Original idea here was to cycle to Scotland, in the end I ran out of time and made it up to Carlisle, which is close enough to Scotland. I stayed longer in the Lake District, which I didnt plan to visit.'),(2,'Stage 2 - St. Malo - Santander','The west coast of France and the North coast of Spain. Completed this stage with my Dad, who caught the Ferry back to England from Santander'),(3,'Stage 3 - The Pyrenees and the French Mediteranian Coast','From Haydayes to err, the other coast. Stopping midway to do some trail running. Plan to do the famous peaks featured in the Tour de France, in both this and the next stage (the Alps)'),(4,'Stage 4 - The Alps','From Monton to Dunkirk, maybe. Weather is not ideal.'),(5,'Stage 5 - Rhone Alpes','I stayed / am staying in a Hotel for 2 weeks in Thonon-les-bains before spending a week or two on an Organic Farm in the region, and then ... Paris, where hopefully I have a job for at least 3 months in a web development agency');
